import React, { useState } from 'react';
import { TextField, Button, Box, Typography, Snackbar, Alert } from '@mui/material';
import axios from 'axios';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend } from 'recharts';

const CallRecordForm = () => {
    const [caller, setCaller] = useState('');
    const [callee, setCallee] = useState('');
    const [duration, setDuration] = useState('');
    const [callType, setCallType] = useState('');
    const [error, setError] = useState('');
    const [success, setSuccess] = useState(false);
    const [analyticsData, setAnalyticsData] = useState([]);

    const handleSubmit = async (e) => {
        e.preventDefault();
        if (!caller || !callee || !duration || !callType) {
            setError('Please fill in all fields');
            return;
        }
        try {
            const response = await axios.post('http://localhost:8081/call-records', { 
                caller, 
                callee, 
                duration: parseInt(duration, 10), 
                callType 
            });
            setCaller('');
            setCallee('');
            setDuration('');
            setCallType('');
            setError('');
            setSuccess(true);
        } catch (err) {
            setError('Failed to save call record');
            console.error(err);
        }
    };

    const fetchAnalytics = async () => {
        try {
            const response = await axios.get('http://localhost:8080/analytics/call-types');
            const data = Object.keys(response.data).map(key => ({ name: key, value: response.data[key] }));
            setAnalyticsData(data);
        } catch (err) {
            setError('Failed to fetch analytics data');
            console.error(err);
        }
    };

    return (
        <Box sx={{ p: 2, maxWidth: 600, margin: '0 auto' }}>
            <Typography variant="h4" gutterBottom>
                Telecom Analytics Dashboard
            </Typography>
            <Typography variant="h6">Add Call Record</Typography>
            {error && <Typography color="error">{error}</Typography>}
            <form onSubmit={handleSubmit}>
                <TextField
                    label="Caller"
                    value={caller}
                    onChange={(e) => setCaller(e.target.value)}
                    fullWidth
                    margin="normal"
                />
                <TextField
                    label="Callee"
                    value={callee}
                    onChange={(e) => setCallee(e.target.value)}
                    fullWidth
                    margin="normal"
                />
                <TextField
                    label="Duration (in seconds)"
                    type="number"
                    value={duration}
                    onChange={(e) => setDuration(e.target.value)}
                    fullWidth
                    margin="normal"
                />
                <TextField
                    label="Call Type"
                    value={callType}
                    onChange={(e) => setCallType(e.target.value)}
                    fullWidth
                    margin="normal"
                />
                <Button type="submit" variant="contained" color="primary" fullWidth>
                    Enter
                </Button>
            </form>
            <Button onClick={fetchAnalytics} variant="contained" color="secondary" fullWidth sx={{ mt: 2 }}>
                Analyze
            </Button>
            <Snackbar open={success} autoHideDuration={6000} onClose={() => setSuccess(false)}>
                <Alert onClose={() => setSuccess(false)} severity="success" sx={{ width: '100%' }}>
                    Call record added successfully!
                </Alert>
            </Snackbar>
            {analyticsData.length > 0 && (
                <BarChart width={600} height={300} data={analyticsData} margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis dataKey="name" />
                    <YAxis />
                    <Tooltip />
                    <Legend />
                    <Bar dataKey="value" fill="#8884d8" />
                </BarChart>
            )}
        </Box>
    );
};

export default CallRecordForm;
